    const [isUser, setIsUser] = useState(false);
    const [islogin, setIslogin] = useState(false);
    return ( <
        div className = "App" >
        <
        Header isUser = { isUser }
        setIsUser = { setIsUser }
        islogin = { islogin }
        setIslogin = { setIslogin }
        /> {
            isUser ? < Homedesktop / > : < Login setIsUser = { setIsUser }
            islogin = { islogin }
            setIslogin = { setIslogin }
            />} <
            Footer / >
                <
                /div>
        );
    }

    export default App;
